import React from "react";
import styled from 'styled-components';


const Login = styled.img`
  width: 32px;
  height: 32px;
`;

const Burger = styled.img`
   width: 32px;
  height: 32px;
`;
class PageLayout extends React.Component {
    render() {
      return(
      <div>
      <Login />      
      <Burger/>
      </div>
      ) 
    }
  }


export default Header;
